
In 2008, BGI completed a first draft of the genome sequence of a three-year old female giant panda named Jingjing, who was used as a model for the 2008 Olympics in Beijing, China (<a href="http://dx.doi.org/10.1038/nature08696">doi: 10.1038/nature08696</a>). Using second-generation Illumina GA sequencing data, the first de novo genome assembly was created using short-read sequencing technology.  Here you will find the giant panda genome sequence assembly as well as annotation information, such as gene structure and function, non-coding RNAs, and repeat elements.  Also presented are polymorphism information detected in the diploid genome, including SNPs, indels, and structural variations (SVs).  The assembly was done using SOAPdenovo software and the panda genome data is visualized via MapView, which is powered by the Google Web Toolkit.', 165356240896, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100004/', 'Published', 'GigaDBUploadForm_Panda.xls', '1cfb49f6a622ae1c2599e6dd2eed9785', '2011/07/06', null, 1 );
