insert into dataset values( 25, 8, 25, '10.5524/100004', 'Genomic data from the giant panda (<em>Ailuropoda melanoleuca</em>). ', 'The giant panda (<em>Ailuropoda melanoleuca</em>) is considered a symbol of China and is a much loved animal all around the world.  It is also one of the world’s most endangered species, making it a flagship species for conservation efforts.  As the first fully sequenced Ursidae and the second fully sequenced carnivore after the dog, the whole genome sequence and annotation data provide an unparalleled amount of information to aid in understanding the genetic and biological underpinnings of this unique species, and will help contribute to disease control and conservation efforts.
