insert into sample select 452, 23, 'age="3 year",sex="female",tissue="peripheral blood",description="We sequenced a 3-year old female panda named Jingjing, who came from the Chengdu Research Base of Giant Panda Breeding and was chosen as the model of 2008 Olympic Mascot. The captive breeding of pandas follows principles meant to maintain genetic polymorphism, so it is difficult to find a homozygous panda because mating of close relatives is not allowed. The genetic background of Jingjing’s father comes solely from pandas in the Liangshan Mountain, and Jingjing’s mother’s genetic background has half from pandas in the Liangshan Mountain and half from the Minshan Mountain. Liangshan and Minshan are the two major locations of wild giant pandas. So Jingjing is a relatively good candidate for sequencing."', 'SAMPLE:SRS004381' where not exists ( select null from sample where id = 452 ); 
